{
  "properties": {
    "contentType": "application/vnd.ms-azure-apim.graphql.schema",
    "document": {
      "value": "
             type Family {
              id: Int!
              name: String!
              members: [Person]
            }

            type Person {
              id: Int!
              firstName: String!
              lastName: String!
              family: Family
            }

            type Query {
              allFamilies: [Family]
              familyById(id: Int!): Family
              allPeople: [Person]
              personById(id: Int!): Person
              familyMembers(familyId: Int!): [Person]
            }

            type Mutation {
              createFamily(id: Int!, name: String!): Family
              createPerson(
                id: Int!
                firstName: String!
                lastName: String!
                familyId: Int!
              ): Person
            }

            type Subscription {
              onFamilyCreated: Family!
              onPersonCreated: Person!
              onSpecificFamilyCreated(id: Int): Family!
              onSpecificFamilyCreatedMultiFilter(id: Int, name: String): Family!
              onFamilyGet: Family!
              onSpecificFamilyGet(id: Int!): Family!
              onFamiliesGet: [Family!]!
            }"
    }
  }
}

